import React from 'react';
import styled from "styled-components";

const Landing = () =>{
    return(
        <Wrapper>
               <Title>Welcome to the star wars database</Title>
               <Description>This website is to provide all informations about star wars! 
                   <br />
                   Below you will find informations for all the people, planets and starships throughout the all the sega of star wars.
                </Description>
        </Wrapper>
    )
}

export {Landing};

const Wrapper = styled.div`
padding-top: 10%;
`;

const Title = styled.div`
    font-weight: 1.4em;
`;

const Description = styled.div`
border: 1px solid black;
box-shadow: 0 14px 28px rgba(0,0,0,0.25), 0 10px 10px rgba(0,0,0,0.22);
`;
